INSERT INTO `craft_freeform_feed_messages` VALUES (1,1,'The Freeform 3.11 beta is now underway! New features include support for editing other Craft elements, creation of Calendar Events, ability to update file-based email notification templates directly inside the CP, a full-screen HTML & Rich Text editor inside the form builder, and refining other areas of Freeform to be more robust. If you\'d like to be a part of the 3.11 beta, please visit the following page for instructions and more details: https://docs.solspace.com/craft/freeform/v3/setup/betas.html','[]','info',0,'2021-02-25 14:03:00','2021-03-01 23:48:43','2021-03-01 23:48:43','3dd9485f-a40f-426c-81e3-633741b25c91'),(2,9,'Support for GraphQL implementations now available!','[]','new',0,'2021-01-05 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','8fd2f615-51a7-457f-977a-553eef7078c5'),(3,9,'Added support for Google Tag Manager with AJAX. Just tick off a checkbox inside the form builder to get started.','[]','new',0,'2021-01-05 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','eb6db63c-969c-4e2c-a956-3ac3e64f3da1'),(4,9,'You can now render Twig inside form layout HTML blocks, allowing for things like having users review entered data from previous pages, etc.','[]','new',0,'2021-01-05 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','81f5100c-322b-4c66-8cd6-d97bb81206ae'),(5,9,'Added the ability to delete all submissions at once (including paginated results) for a form.','[]','new',0,'2021-01-05 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','71403b2b-9bd2-414b-bdff-513d81e15387'),(6,9,'Several large improvements to the Weekly Digest email! Introducing a new client-friendly stats-only Digest email option (in addition to the \'developer\' one with alerts and notices). We also added the ability to choose between weekly or daily Digest email notifications, and select which day of the week that the weekly digest is sent on. You can also choose whether Digest email notifications are sent only on production environments (looking for \'production\' environment name).','[]','new',0,'2021-01-05 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','d0e6c05c-aa85-4512-ab7b-64b1d3263a7f'),(7,9,'Updated AJAX to work with multipage forms, including Payment forms.','[]','new',0,'2021-01-05 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','4ab749b8-eb84-4971-8d62-d42d341d59bc'),(8,9,'Overhauled the Freeform Javascript plugin to be more robust, reworked the API to make it way more developer-friendly. Made it easier for anyone to adjust or complement form functionality regardless of their particular site setup. This is a backward-compatible change, so you do not need to adjust your templates if you\'re currently using any of the old-style overrides.','[]','new',0,'2021-01-05 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','a6f68c49-1edb-4368-b588-091bfef93bb2'),(9,9,'Freeform now automatically generates Text-only versions when no Text-only version is specified in the email notification template.','[]','new',0,'2021-01-05 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','256d4f54-cdfc-4398-a51a-d9773f78ce94'),(10,9,'Updated references of \'Composer\' (Freeform\'s form builder) to \'Form Builder\'.','[]','new',0,'2021-01-05 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','f7cea8fa-4f86-49c9-8187-8ece427cb051'),(11,10,'Would you be willing to take a few minutes to complete a survey about your experience with Freeform? We value your feedback and you will also be entered into a draw to win a $100* Amazon gift card! It should only take a couple of minutes and you can remain anonymous if you like. Visit the following link to complete: https://solspace.typeform.com/to/KxJivfHE\n  *For those participants outside the USA, we can provide an Amazon gift card suitable for your country of residence.','[]','info',0,'2020-12-10 14:03:00','2021-03-01 23:48:43','2021-03-01 23:48:43','018a1bfd-8890-429b-9e32-aee4a770c914'),(12,20,'Redesigned Dashboard that allows you to have better control over Freeform and the built-in notices and warnings area gives your more peace of mind as it keeps you informed about issues and new features that may specifically affect this site.','[]','new',0,'2020-11-04 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','be1be8d8-5211-429f-95d7-84a5b9f0609e'),(13,20,'The \'Important Update Notices\' area in the Dashboard keeps you informed about issues that may specifically affect this site, while the \'What\'s New\' area in the Dashboard lets you know about new features available in the current version you\'ve just updated to.','[]','new',0,'2020-11-04 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','584f24ea-93dc-4832-8c1c-6e91caea5603'),(14,20,'The \'Weekly Digest\' email notification will keep you in the loop about your website\'s Freeform form performance and status. It includes a snapshot of the previous week\'s performance and any logged errors and upgrade notices.','[]','new',0,'2020-11-04 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','379e868a-7dab-4e04-833c-40937cd2129d'),(15,20,'You can now define general success and error messages for each form inside the form builder. Choose to set and define \'Loading...\' indicators on your submit buttons in forms as well.','[]','new',0,'2020-11-04 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','9bde5f95-12eb-46fa-a544-1a4709db7a47'),(16,20,'A Freeform plugin badge is now available to show the error/notice count, spam submission count, submission count when enabled.','[]','new',0,'2020-11-04 14:00:00','2021-03-01 23:48:43','2021-03-01 23:48:43','cffef7cf-1cf2-48be-9301-9e215420bccb'),(17,21,'Freeform 3.11 is now available! New features include the ability to edit other Craft Elements and map to Calendar Events with the Element Connections feature, full-screen HTML & Twig and Rich Text editor inside the form builder, ability to update file-based email notification templates directly inside the CP, support for searching by submissions\' field values in the CP Submissions index, more granular submission viewing and management permissions, ability to lazy load reCAPTCHA scripts, various improvements to the Freeform JS plugin, and a wide variety of other improvements!','[]','info',0,'2021-04-20 06:00:00','2021-05-04 12:17:47','2021-05-04 12:17:47','0ab9fda2-a082-4c30-9445-b173ea88e968');
